import { useState } from "react";


export function Books(){
    const [book, setBook] = useState(13)

    const handler = (value)=>{
        setBook(book+value)
    }

    return <div className="items">
    <span>Books:</span>
    <button className="addBook" onClick={()=>{handler(1)}}>
        +
    </button>
    <button className="remBook" onClick={()=>{handler(-1)}}>
        -
    </button>
    <span className="totalBooks">{book}</span>
</div>
}
export function Pen(){
    const [pen, setPen] = useState(10)

    const handler = (value)=>{
        setPen(pen+value)
    }

    return <div className="items">
    <span>Pen:</span>
    <button className="addPen" onClick={()=>{handler(1)}}>
        +
    </button>
    <button className="remPen" onClick={()=>{handler(-1)}}>
        -
    </button>
    <span className="totalPens">{pen}</span>
</div>
}

export function Notebook(){
    const [book, setBook] = useState(44)

    const handler = (value)=>{
        setBook(book+value)
    }

    return <div className="items">
    <span>Notebook:</span>
    <button className="addNotebook" onClick={()=>{handler(1)}}>
        +
    </button>
    <button className="remNotebook" onClick={()=>{handler(-1)}}>
        -
    </button>
    <span className="totalNotebooks">{book}</span>
</div>
}

export function Inkpen(){
    const [ink, setInk] = useState(78)

    const handler = (value)=>{
        setInk(ink+value)
    }

    return <div className="items">
    <span>Books:</span>
    <button className="addInkpen" onClick={()=>{handler(1)}}>
        +
    </button>
    <button className="remNotebook" onClick={()=>{handler(-1)}}>
        -
    </button>
    <span className="totalInkpens">{ink}</span>
</div>
}
